import './App.css';
import React from 'react';

import UserLogin from './userLogin';
import {BrowserRouter as Router, Route,  Link} from 'react-router-dom';
import Finaldoctorsdb from './finaldoctorsdb';







function App() {
  return (
    <div className="page">
      <Router>
        <div>
          <Link to="/userLogin"></Link>
          <Link to="/finaldoctorsdb"></Link>

        </div>

          <Route exact path ='/userLogin'>
            <UserLogin />
            </Route> 
          <Route exact path ='/finaldoctorsdb'>
            <Finaldoctorsdb />
          </Route>

      </Router>
    </div>
  );
}

export default App;
